// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract TokenVesting is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    event TokensReleased(address token, uint256 amount);

    // staking token address
    address public stakingToken;
    // staker token address
    address public staker;
    // UNIX time, UTC timestamp, unit second, type uint, consistent with block.timestamp
    // Contract start time, that is the lock start time
    uint256 public start;
    // Lock-in period, for example: 4 years
    uint256 public duration;
    // Truncation time unit for each stage
    uint256 public stageCliffUnit;
    // Total release ratio
    uint256 public totalShares = 100;
    // staked token amount
    uint256 public stakedAmount;

    // Record the withdrawal amount of each currency
    mapping (address => uint256) public released;

    constructor (
        address _stakingToken,
        address _staker,
        uint256 _start,
        uint256 _duration,
        uint256 _stageCliffUnit,
        uint256 _stakedAmount
    ) {
        require(_stakingToken != address(0), "TokenVesting: stakingToken is the zero address");
        require(_staker != address(0), "TokenVesting: staker is the zero address");
        require(_start.add(_duration) > block.timestamp, "TokenVesting: final time is before current time");
        require(_duration >= _stageCliffUnit, "TokenVesting: Period is greater than unit time");

        stakingToken = _stakingToken;
        staker = _staker;
        start = _start;
        duration = _duration;
        stageCliffUnit = _stageCliffUnit;
        stakedAmount = _stakedAmount;
    }

    // Is it time to release
    function isToReleaseTime() public view returns (bool) {
        return block.timestamp >= start.add(duration);
    }

    // release token
    function release(IERC20 token) public {
        uint256 unreleased = releasableAmount(token);
        require(unreleased > 0, "TokenVesting: no tokens are due");
        released[address(token)] = released[address(token)].add(unreleased);
        token.safeTransfer(staker, unreleased);
        emit TokensReleased(address(token), unreleased);
    }

    // Calculate the number of tokens that can be release
    function releasableAmount(IERC20 token) public view returns (uint256) {
        return _vestedAmount(token).sub(released[address(token)]);
    }

    // Calculate the number of released tokens
    function _vestedAmount(IERC20 token) private view returns (uint256) {
        uint256 currentBalance = token.balanceOf(address(this));
        uint256 totalBalance = currentBalance.add(released[address(token)]);

        // Calculate the number of released tokens according to conditions
        if (block.timestamp >= start.add(duration)) {
            return totalBalance;
        } else {
            // Record the number of released tokens
            uint256 vestedAmount = 0;
            if (address(token) == stakingToken) {
                totalBalance = totalBalance.sub(stakedAmount);
            }
            // Cumulative release time
            uint256 cumulativeTime = start;
            // Calculate the number of releases in each stage
            uint256 vestCount = duration.div(stageCliffUnit);
            for (uint256 i = 0; i < vestCount; i++) {
                cumulativeTime = cumulativeTime.add(stageCliffUnit);
                if (cumulativeTime > block.timestamp) {
                    break;
                }
                vestedAmount = vestedAmount.add(totalBalance.div(vestCount));
            }
            return vestedAmount;
        }
    }
}
